import React, { useState } from "react";

function MultiStepForm() {
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({
    input1: "",
    choice: "",
    input2: "",
    input3: "",
    input4: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Form data submitted:", formData);
  };

  const nextStep = () => {
    if (step < 3) {
      setStep(step + 1);
    }
  };

  const prevStep = () => {
    if (step > 1) {
      setStep(step - 1);
    }
  };

  const isStepValid = () => {
    // You can add your validation logic here for each step.
    if (step === 1) {
      return formData.input1 !== "" && formData.choice !== "";
    } else if (step === 2) {
      return (
        formData.input2 !== "" &&
        formData.input3 !== "" &&
        formData.input4 !== ""
      );
    }
    return true; // Step 3 has no validation
  };

  return (
    <div>
      <h1>Multi-Step Form</h1>
      <form onSubmit={handleSubmit}>
        {step === 1 && (
          <div>
            <label>Input 1:</label>
            <input
              type="text"
              name="input1"
              value={formData.input1}
              onChange={handleChange}
            />
            <br />
            <label>Choose an option:</label>
            <select
              name="choice"
              value={formData.choice}
              onChange={handleChange}
            >
              <option value="">Select an option</option>
              <option value="Option 1">Option 1</option>
              <option value="Option 2">Option 2</option>
              <option value="Option 3">Option 3</option>
              <option value="Option 4">Option 4</option>
            </select>
          </div>
        )}

        {step === 2 && (
          <div>
            <label>Input 2:</label>
            <input
              type="text"
              name="input2"
              value={formData.input2}
              onChange={handleChange}
            />
            <br />
            <label>Input 3:</label>
            <input
              type="text"
              name="input3"
              value={formData.input3}
              onChange={handleChange}
            />
            <br />
            <label>Input 4:</label>
            <input
              type="text"
              name="input4"
              value={formData.input4}
              onChange={handleChange}
            />
          </div>
        )}

        {step === 3 && (
          <div>
            <p>Review your data:</p>
            <pre>{JSON.stringify(formData, null, 2)}</pre>
          </div>
        )}

        <div>
          {step > 1 && (
            <button type="button" onClick={prevStep}>
              Previous
            </button>
          )}
          {step < 3 && (
            <button type="button" onClick={nextStep} disabled={!isStepValid()}>
              Next
            </button>
          )}
          {step === 3 && (
            <button type="submit" disabled={!isStepValid()}>
              Submit
            </button>
          )}
        </div>
      </form>
    </div>
  );
}

export default MultiStepForm;
